@JudylynS22 An easy recipe ‘Kenobi’ May like: Peanut butter &amp; Banana Dog Treats: *Only 100% All Natural Peanut Butter: *Note: no other ingredients* 
1:2 ratio approx
-1 ripe mashed banana +1 cup Natural PB. Mix. Drop by rounded tsps on wax paper on plate. Freeze. Store in freezer bag(s).🐶 https://t.co/jqywARM0rm

@tyhenrymedium @eentertainment @BravoTV So basically: 

“Bravo Tyler Henry!”

Sorry everyone, I couldn’t resist! 😂❤️🥳💯👏🏼😘

@FightingwithF I have 6/20 so I’m glad I ‘failed’ this 😂 ...not really. 
:(...
Hoping not to require 3 potential upcoming surgeries or my score will increase.

@cmclymer 1. I stopped protecting people &amp; took the risk to be fully authentic regardless of how anyone would or wouldn’t accept me. 
2. I set healthy boundaries with people &amp; stood up for myself &amp; others with #ChronicIllness advocating without pause. I still am!
3. I let some hurts go. 💜

